import React from 'react';
import Rating from '@mui/material/Rating';

import './professorBio.scss';

const ProfessorBio = (props) => {
  console.log('PB:', props.profDetails);
  return (
    <div className="secParent">
      <div className="profStats">
        <ul className="profStatsNumerical">
          {props.profDetails.skillsUpvote ? Object.keys(props.profDetails.skillsUpvote).map((k, i) => (
            <li key={i}>
              {k} <Rating value={props.profDetails.skillsUpvote[k]} readOnly />
            </li>
          )) : null}
        </ul>
        <div className="profStatsPie">
          Piechart
        </div>
      </div>

      <div className="profStats">
        <ul>
          <li>  </li>
        </ul>
      </div>
    </div>
  )
}

export default ProfessorBio;
